import React from 'react'
import Navigation from '../components/Navigation'
import Container from 'react-bootstrap/Container'
import styled from 'styled-components'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

import Bg_image from '../assets/images/background1.jpg'

const Jumbo = styled.div `
    width:100%;
    height: 100vh;
    background-image: linear-gradient(rgba(0, 0, 0, 0.527),rgba(0, 0, 0, 0.5)) , url(${Bg_image});
`;
const HeaderSection = styled.div `
    margin:0;
    position:absolute;
    top:30%;
    left:10%;
    -ms-transform: translate-Y(-40%)
    transform: translateY(-40%)
`;
const Section = styled.div `
   border-radius:50px;
`;

function Landing() {
    return (
    <React.Fragment>
        <Navigation />

        <Jumbo>
            <HeaderSection>
                <Container fluid='md' className='align-middle'>
                    <Row className="align-items-center">
                        <Col>
                            <h1 className="text-light display-2"> Tap into the next generation of audio-visual NFTs</h1>
                        </Col>
                        <Col>

                        </Col>
                    </Row>
                </Container>
            </HeaderSection>
        </Jumbo>

        <Section>
            <Container>
                <h1> Section Content</h1>
            </Container>
        </Section>

    </React.Fragment>


    )
}

export default Landing
